<html><head><title>Packages for testing/x86_64</title>
<script>
function searchPackages(inputId, listId) {
    const input = document.getElementById(inputId).value.toLowerCase();
    const listItems = document.getElementById(listId).getElementsByTagName('li');
    for (let i = 0; i < listItems.length; i++) {
        const txt = listItems[i].innerText.toLowerCase();
        listItems[i].style.display = txt.includes(input) ? '' : 'none';
    }
}
</script>
</head><body>
<a href="../../index.html">../</a>
<h1>Packages for testing/x86_64</h1>
<input type="text" id="archSearch_testing/x86_64" placeholder="Search..." onkeyup="searchPackages('archSearch_testing/x86_64', 'pkgList_testing/x86_64')">
<ul id="pkgList_testing/x86_64">
</ul></body></html>
